Essential Functions:
1.       Supports Business Unit Controller in:
·         Records revenue each month for Unit, Fee for Service and Fixed Price contracts;
·         Loads project budgets into Oracle/Revenue Wizard and maintaining key member lists (project set up) and other project data in Oracle and associated systems and schedules;
·         Prepares project level actual versus budget/forecast variance analysis monthly as well as monthly reports for distribution in analyzing monthly results;
·         Coordinates monthly forecasting of financial results (backlog);
·         Meets established deadlines for Revenue and Backlog submittals;
·         Timely preparation of project close out reconciliations including issue identification and escalation, if necessary;
·         Serves as a key contact point for interpretation and investigation of financial results in assigned area for the assigned Project Manager(s)/Project Lead(s); and
·         Reviews executed Work Orders and Change Orders for bonus other anomalies. 
2.       Works closely with Business Unit Controller to: 
·         Captures, assesses and consolidates results; and
·         Prepares key reports such as annual cost and expense budgets, cost rates, cost and expense forecasting, monthly utilization, headcount, revenue backlog analysis, and/or gross profit for assigned area. 
·         Assists in running P&L’s (Profit and Loss), G/L (General Ledger) account detail, and Project level reports for Business Unit Controller(BUC) review; and
·         Produces ad hoc reports as required with assistance.
3.       Attends project meetings as applicable to support assigned areas. Attends project kick-off meetings to capture and process relevant data for set up of newly awarded projects onto financial systems and schedules.  Attends monthly project review (MPRs) meetings to ensure understanding/concurrence of project status, potential issues and the accuracy of the forecast. 
4.       Monitors the overall health of assigned projects including but not limited to revenues, gross profit, receivables, and unbilled amounts as well as project close outs and reconciliations.
5.       Acts as back up for BUC in supporting and responding to requests received from project managers and others as needed.

Job Summary
NOA Living is searching for a candidate to fill a full time Graphic Design position. This position requires great energy, strong work ethics, organization skills, and interpersonal skills. The position entails creating design solutions that have a high visual impact, having a strong understanding of graphic design principles, the ability to understand and interpret complex intertwining patterns, and a great understanding on creating designs meant to be displayed on multiple medias ( print, digital, fabric, etc ). The position requires a strong ability with computer applications and, specifically, the Adobe Suite. 

Duties Entail:
• Interpreting client & creative director’s needs and developing a concept to suit their purpose;
• Presenting finalized ideas and concept to the creative director;
• Working as part of a team with printers, photographers, creative directors and web developers to produce visually stunning solutions on point and on time;
• Proofreading to produce accurate and high-quality work;
• Demonstrating mastery with Photoshop, Illustrator, & InDesign;
• Developing interactive designs;

Applicant Requirements:
• Bachelor’s Degree in Graphic Design or related field
• Superior verbal and written professional English skills
• Excellent computer application skills on both Mac & PC including the Adobe CS6 Suite with emphasis on Illustrator, Photoshop, & InDesign.
• Ability to work independently and under some pressure to meet deadlines.
• High Energy

Email resume to:  gilles@noaliving.com
